@elliott_downing They know, of course, that it won't work forever. It never does. The rage always comes. Someone always gets hurt, often irreparably.

Many abusers apologize and send flowers, but not him. 

Next time he throws a lamp or a hot iron, though, they hope they won't be in the room.

@Russell_Arnott What really scared me at the big cycle around Bristol last September was the incandescent rage (and subsequent dangerous driving) some of the drivers who were held up displayed. 

1. This will not persuade people.
2. Is provoking rage a plan designed to get injured martyrs ?
